import Collapsible from "../../Collapsible";

const ListPage = () => {

    return (
        <div className="main-page">
            <Collapsible label="Chest Pain">
                <h1>Chest Pain</h1>
            </Collapsible>
            <hr />
            <Collapsible label="Hemoptysis" />
            <hr />
            <Collapsible label="Headache" />
        </div>
    );
}

export default ListPage;
